package com.cxd.cxd4android.model;import java.io.Serializable;/** * Created by wangxiaofa on 16/10/28. * 华兴交互web view的model */public class GhbH5Model implements Serializable {    private String title;    private String webUrl;    private String type;    public String getWebUrl() {        return webUrl;    }    public void setWebUrl(String webUrl) {        this.webUrl = webUrl;    }    public String getTitle() {        return title;    }    public void setTitle(String title) {        this.title = title;    }    public String getType() {        return type;    }    public void setType(String type) {        this.type = type;    }}